import React from 'react';
import '../App.css';

export default class Form extends React.Component {

	state={
		name: "name",
		rollno: "roll number",
		phone: "phone",
		email: "email",
		password: "password",
		confirmpassword: "password"
	};

	handleChangename=event =>{
		console.log(event.target.value);
		this.setState({name: event.target.value});
	};

	handleChangerollno=event =>{
		console.log(event.target.value);
		this.setState({rollno: event.target.value});
	};

	handleChangephone=event =>{
		console.log(event.target.value);
		this.setState({phone: event.target.value});
	};

	handleChangeemail=event =>{
		console.log(event.target.value);
		this.setState({email: event.target.value});
	};

	handleChangepassword=event =>{
		console.log(event.target.value);
		this.setState({password: event.target.value});
	};

	handleChangeconfirmpassword=event =>{
		console.log(event.target.value);
		this.setState({confirmpassword: event.target.value});
	};

	handleSubmit=()=>{console.log(this.state);};

	render(){
		return(
			<div>
			<div><input value={this.state.name} onChange={this.handleChangename} /></div>
			<div><input value={this.state.rollno} onChange={this.handleChangerollno} /></div>
			<div><input value={this.state.phone} onChange={this.handleChangephone} /></div>
			<div><input value={this.state.email} onChange={this.handleChangeemail} /></div>
			<div><input type="password" value={this.state.password} onChange={this.handleChangepassword} /></div>
			<div><input value={this.state.confirmpassword} onChange={this.handleChangeconfirmpassword} /></div>
			<div><button onClick={this.handleSubmit}>Submit</button></div>
			</div>
			);
	}
}
